import React from 'react'
import './Display.css'
import data_new from '../Assets/data_new'

import Item from '../Item/Item'

const Display = (props) => {
  return (
    <div className='display'>
        <div className="two_items">
            {data_new.map((item,i)=>{
                return <Item key={i} id={item.id} image={item.image}/>
            })}
        </div>
      
    </div>
  )
}

export default Display
